import React from 'react';
import PropTypes from 'utils/propTypes';

import { Table, Progress } from 'reactstrap';

import Avatar from 'components/Avatar';

import withBadge from 'hocs/withBadge';

const AvatarWithBadge = withBadge({
  position: 'bottom-right',
  color: 'success',
})(Avatar);

const CountryProgressTable = ({ headers, countryData, ...restProps }) => {
  return (
    <Table  responsive hover {...restProps}>
      <thead>
        <tr className="text-capitalize align-middle text-center">
          {headers.map((item, index) => <th key={index}>{item}</th>)}
        </tr>
      </thead>
      <tbody>
        {countryData.map(({ countryregion, image, location, countrycode }, index) => (
          <tr key={index}>  
            <td className="align-middle text-center">{countryregion}</td>
            <td className="align-middle text-center">
              <AvatarWithBadge src={require('../assets/flags/png/'+countryregion+'.png')} />
            </td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

CountryProgressTable.propTypes = {
  headers: PropTypes.node,
  countryData: PropTypes.arrayOf(
    PropTypes.shape({
      countryregion: PropTypes.string,
      image: PropTypes.string,
      location: PropTypes.map,
      countrycode: PropTypes.map,
    })
  ),
};

CountryProgressTable.defaultProps = {
  headers: [],
  countryData: [],
};

export default CountryProgressTable;
